(3, 5, '_form', '<div class=\"form_row\"><div class=\"field w_50\"><label>Ваше имя</label>[text* text-81 class:form_control placeholder \"Иванов Иван Иванович\"]</div><div class=\"field w_50\">\n<label>Телефон</label>[tel* tel-952 class:phone class:form_control placeholder \"+375 (__) ___ __ __\"]</div><div class=\"field w_50\"><label>E-mail</label>[email email-320 class:form_control placeholder \"ivanovivan@mail.ru\"]</div><div class=\"field w_50\"><label></label>[mfile upload-file-346 limit:2097152 id:file class:file]</div><div class=\"field m_hide\"><label>Сообщение</label>[textarea textarea-611 class:form_control placeholder \"Введите ваш вопрос\"]</div><div class=\"b_row\"><div class=\"field w_50\"><div class=\"checkbox\"><input type=\"checkbox\" id=\"aggree3\" checked=\"checked\"/><label for=\"aggree3\">Отправляя заявку, вы даёте согласие на обработку персональных данных и соглашаетесь с политикой конфиденциальности.</label></div></div><div class=\"field w_50\"><button class=\"btn_default\" type=\"submit\">Оставить заявку</button></div></div></div>'),
