(5, 1, '2022-05-18 13:15:58', '2022-05-18 10:15:58', '<div class=\"form_row\"><div class=\"field w_50\"><label>Ваше имя</label>[text* text-81 class:form_control placeholder \"Иванов Иван Иванович\"]</div><div class=\"field w_50\">\r\n<label>Телефон</label>[tel* tel-952 class:phone class:form_control placeholder \"+375 (__) ___ __ __\"]</div><div class=\"field w_50\"><label>E-mail</label>[email email-320 class:form_control placeholder \"ivanovivan@mail.ru\"]</div><div class=\"field w_50\"><label></label>[mfile upload-file-346 limit:2097152 id:file class:file]</div><div class=\"field m_hide\"><label>Сообщение</label>[textarea textarea-611 class:form_control placeholder \"Введите ваш вопрос\"]</div><div class=\"b_row\"><div class=\"field w_50\"><div class=\"checkbox\"><input type=\"checkbox\" id=\"aggree3\" checked=\"checked\"/><label for=\"aggree3\">Отправляя заявку, вы даёте согласие на обработку персональных данных и соглашаетесь с политикой конфиденциальности.</label></div></div><div class=\"field w_50\"><button class=\"btn_default\" type=\"submit\">Оставить заявку</button></div></div></div>\n1\nПисьмо из контактной формы\n[_site_title] <wordpress@e-distant.local>\n[_site_admin_email]\nИмя: [text-81]\r\nТелефон: [tel-952]\r\nEmail: [email-320]\r\nСообщение: [textarea-611]\r\n-- \r\nЭто сообщение отправлено с сайта [_site_title] ([_site_url])\n\n[upload-file-346]\n\n\n\n[_site_title] \"[your-subject]\"\n[_site_title] <wordpress@e-distant.local>\n[your-email]\nСообщение:\r\n[your-message]\r\n\r\n-- \r\nЭто сообщение отправлено с сайта [_site_title] ([_site_url])\nReply-To: [_site_admin_email]\n\n\n\nСпасибо за Ваше сообщение. Оно успешно отправлено.\nПри отправке сообщения произошла ошибка. Пожалуйста, попробуйте ещё раз позже.\nОдно или несколько полей содержат ошибочные данные. Пожалуйста, проверьте их и попробуйте ещё раз.\nПри отправке сообщения произошла ошибка. Пожалуйста, попробуйте ещё раз позже.\nВы должны принять условия и положения перед отправкой вашего сообщения.\nПоле обязательно для заполнения.\nПоле слишком длинное.\nПоле слишком короткое.\nПри загрузке файла произошла неизвестная ошибка.\nВам не разрешено загружать файлы этого типа.\nФайл слишком большой.\nПри загрузке файла произошла ошибка.\nФормат даты некорректен.\nВведённая дата слишком далеко в прошлом.\nВведённая дата слишком далеко в будущем.\nФормат числа некорректен.\nЧисло меньше минимально допустимого.\nЧисло больше максимально допустимого.\nНеверный ответ на проверочный вопрос.\nНеверно введён электронный адрес.\nВведён некорректный URL адрес.\nВведён некорректный телефонный номер.', 'Контактная форма 2', '', 'publish', 'closed', 'closed', '', 'kontaktnaya-forma-1', '', '', '2022-05-19 14:26:43', '2022-05-19 11:26:43', '', 0, 'http://e-distant.local/?post_type=wpcf7_contact_form&#038;p=5', 0, 'wpcf7_contact_form', '', 0),
